import React from 'react'
import {Container , Row, Col , Card , CardBody, CardImg, CardFooter, CardTitle, CardHeader, CardSubtitle} from 'reactstrap'
const Features = ({svg, title,  color }) => {
    return (
        <div className="feature">
            <Card>
                    
                        
                    
                    
                    <span className="card_icon" style={{color:`${color}`}}>
                        {svg}
                        </span>
                        <CardTitle>
                       {title}
                        </CardTitle>

                      
                   

                </Card>
            
        </div>
    )
}

export default Features
